export default function Test02() {

    const [data, setData] = useState('');

    const handlingEvent = (e) => {
        setData(e.target.value);
    }

    return (
        <>
            <form>

                <input type="text"
                    value={data}
                    onChange={handlingEvent}></input>
            </form>
        </>
    )
}
